import React from 'react'
import { Container } from 'react-bootstrap'

import './Login.css';
import HomeNav from '../Home/HomeNav';

function Login() {
  return (
    <>        
    <HomeNav/>
    <Container fluid className='bg-dark justify-content-md-center text-light bg'>
    <h1>Login</h1>
    

    </Container>
      
    </>
  )
}

export default Login
